import React from 'react';
import { Link } from "react-router-dom";
const SuccessPage = () => {

    return (
        <div>
            <h1>Thanks for Renting</h1>
            <Link to={'/cart/success'}>
                <button>Return to Dashboard</button>
             </Link> 
        </div>
    )
}

export default SuccessPage;
